<div class=""d-flex align-items-center flex-column"" style=""margin-top:75px; margin-left:120px"">

<h1>AboutUs</h1>
<p class=""ml-3 d-flex align-items-start "" style=""margin-right:100px"" >
    Маленькие мечты и грандиозные планы<br />
    GeekStore – самый большой онлайн-ритейлер в стране. Уже 14 лет мы воплощаем маленькие мечты и грандиозные планы миллионов людей. У нас можно найти буквально все. Мы продаем по справедливой цене и предоставляем гарантию, так как считаем, что онлайн-шопинг должен быть максимально удобным и безопасным. И каждый раз, когда кто-то нажимает «Купить», мы понимаем, что делаем нужное дело.
    <br />
    <br />
    Наша цель — быть полезными
    Мы верим, что вещи существуют для того, чтобы делать жизнь проще, приятнее и добрее. Поэтому и поиск той самой вещи должен быть быстрым, удобным и приятным. Мы не просто продаем бытовую технику, электронику, украшения или вино. Мы помогаем найти именно то, что нужно, в одном месте и без лишних волнений, чтобы вы не тратили жизнь на поис");
            WriteLiteral(@"ки, а просто жили счастливо. Rozetka — это универсальный ответ на любой запрос, начало поиска и его конечная остановка, настоящий помощник. Мы навсегда избавляем своих покупателей от неприятных компромиссов, исполняем желания и позволяем мечтать смелее. Благодаря разумному поиску и честному сервису мы делаем жизнь наших клиентов немножко лучше прямо сейчас.
    <br />
    <br />
    Счастье начинается с простых вещей
    И мы помогаем найти эти вещи: влюбленным подсказываем, чем удивить друг друга; спортивных мотивируем никогда не сдаваться и быстрее прогрессировать; хозяйственным даем возможность создать настоящий уют. Мы хотим, чтобы вы знали, что ищете, и могли аргументировать свой выбор. Для этого мы снимаем видеообзоры, пишем статьи и отслеживаем новинки.
    <br />
    <br />
    Чтобы мечты осуществлялись легко
    Мы открываем огромные офлайн-магазины, чтобы вы могли прийти, подержать в руках и протестировать понравившийся продукт. Мы хотим, чтобы у нас был лучший в мире сервис, поэтому обучае");
            WriteLiteral(@"м сотрудников не только технической стороне работы, но и работе с клиентом. А если вам, наоборот, хочется поменьше общаться с людьми — для этого у нас есть почтоматы: сделали заказ, выбрали почтомат, забрали по дороге домой или на работу. Всё.
    Подробнее: danik.ravlik@mail.ua
</p>
</div>

